class Config {
  public registerUrl = "";
  public loginUrl = "";
  public timeInGermanyUrl = "";
}

class DevelopmentConfig extends Config {
  public registerUrl = "http://localhost:3001/api/auth0/register/";
  public loginUrl = "http://localhost:3001/api/auth0/login/";
  public timeInGermanyUrl = "http://localhost:3001/api/time-in-germany"
}

class ProductionConfig extends Config {
  public registerUrl = "https://dork-vacation-management.herokuapp.com/api/auth/register/";
  public loginUrl = "https://dork-vacation-management.herokuapp.com/api/auth/login/";
  public vacationUrl = "https://dork-vacation-management.herokuapp.com/api/vacations/";
  public imageUrl = "https://dork-vacation-management.herokuapp.com/api/vacations/images/";
  public followUrl = "https://dork-vacation-management.herokuapp.com/api/follow-vacations/";
}

const config =
  process.env.NODE_ENV === "development"
    ? new DevelopmentConfig()
    : new ProductionConfig();

export default config;
